package com.studio.builder.model;import javax.persistence.Table;/** * description: * author:          song * createDate:      2017/10/25 */@Table(name = "studio_Template")public class Template extends BaseModel {    private String templateName;    private String parentID;    private String fileName;    private String fileExtensions;    private String filePrefix;    private String content;    private String comment;    public String getTemplateName() {        return templateName;    }    public void setTemplateName(String templateName) {        this.templateName = templateName;    }    public String getParentID() {        return parentID;    }    public void setParentID(String parentID) {        this.parentID = parentID;    }    public String getFileName() {        return fileName;    }    public void setFileName(String fileName) {        this.fileName = fileName;    }    public String getFileExtensions() {        return fileExtensions;    }    public void setFileExtensions(String fileExtensions) {        this.fileExtensions = fileExtensions;    }    public String getFilePrefix() {        return filePrefix;    }    public void setFilePrefix(String filePrefix) {        this.filePrefix = filePrefix;    }    public String getContent() {        return content;    }    public void setContent(String content) {        this.content = content;    }    public String getComment() {        return comment;    }    public void setComment(String comment) {        this.comment = comment;    }}